import { useNavigate } from "react-router-dom";
import leftArrow from "../assets/icons/leftArrow.svg";

const BackButton = () => {
  const navigate = useNavigate();
  return (
    <>
      <div className="cursor-pointer" onClick={navigate(-1)}>
        <img src={leftArrow} alt="leftArrow" />
      </div>
    </>
  );
};

export { BackButton };
